import Logement from '../pages/Logement';

function LogementHome(props) {

    return (
        <div onClick={() => {
            return (<Logement home={props}/>)
        }} className='container-logement-home'>
            <p>{props.title}</p>
        </div>
    );
}

export default LogementHome;
